  const addExpenseHandler = (exp) => {
          expenses.push({exp})



  }
  console.log(expenses)
  return (

    <div className="mx-auto max-w-7xl sm:px-6 lg:px-8">
          <NewExpense onAddExpense = {addExpenseHandler} />
         <Expenses  expense={expenses}></Expenses>
    </div>
  );
}


export default App;
